from PIL import Image
import base64
from io import BytesIO

# base64 인코딩된 이미지 데이터를 여기에 입력하세요
base64_data = """

"""

# base64 데이터를 디코딩하여 이미지로 변환
image_data = base64.b64decode(base64_data)
image = Image.open(BytesIO(image_data))

# 이미지 보기
image.show()

# 이미지 파일로 저장하려면 아래 코드를 사용하세요
image.save("/Users/hwangjunho/Desktop/decoded_image.png")
